// import logo from './logo.svg';
import './headline.css';

const villains = ["me", "her"]

function Villan(props) {
  return (
    <div className="common villain">
      Villain
    </div>
  );
}

function Action(props) {
  return (
    <div className="common action">
      Action
    </div>
  );
}
function SingleHeadline(props) {
  return (
    <div className="flexbox">
      <Villain/>
      <div className="common action">
          Action
      </div>
      <div className="common victim">
          Victim
      </div>
      <div className="common victim">
          Reason
      </div>
    </div>
  );
}

function Headline(props) {
  items = []
  for (const [index, value] of villains.entries()) {
    items.push(<Element key={index} />)
  }
  return (
    <div>
      <SingleHeadline/>
      <SingleHeadline/>
    </div>
  );
}

export default Headline;
